import React, { Component } from 'react';
import Prism from "prismjs"
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import '../../ReactJs/styles.css'
import Sidebar from '../sidebar';
import PrismCode from '../../ReactJs/prismCode';


const titles = {backgroundColor:'#F0F8FF', padding:'1px', fontSize:'16px'}

const styles = theme => ({
  paper: {
      margin: theme.spacing(1),
      padding: theme.spacing(1)
  },
  smMargin: {
      margin: theme.spacing(1)
  },
  actionDiv: {
      textAlign: "center"
  }
})


const evalRPN = `
const evalRPN = function (tokens) {
  const stack = []
  const isOperator = token => token === '+' || token === '-' || token === '*' || token === '/'
  for (const token of tokens) {
    if (isOperator(token)) {
      const b = stack.pop()
      const a = stack.pop()
      let result = 0
      switch (token) {
        case '+':
          result = a + b
          break
        case '-':
          result = a - b
          break
        case '/':
          result = a / b
          result = result < 0 ? Math.ceil(result) : Math.floor(a / b) // 注意负数向上取整
          break
        default:
          result = a * b
      }
      stack.push(result)
    } else {
      stack.push(parseInt(token, 10))
    }
  }
  return stack[0]
}
console.log(evalRPN(["4", "13", "5", "/", "+"]))`.trim();

const convertToTitle = `
var convertToTitle = function(n) {
  var A = "A".charCodeAt(0);
  var str = "";
  while(n > 0) {
      n--;
      str = String.fromCharCode(A+n%26) + str;
      n =parseInt(n/26);
  }

  return str;
};

console.log(convertToTitle(701))`.trim();

const largestNumber = `
const largestNumber = function (nums = []) {
  nums.sort((a, b) => {
    const digitsA = a.toString(10) + b.toString(10)
    const digitsB = b.toString(10) + a.toString(10)
    for (let i = 0; i < digitsA.length; i++) {
      const digitB = parseInt(digitsB[i], 10)
      const digitA = parseInt(digitsA[i], 10)
      if (digitB > digitA || digitB < digitA) {
        return digitB - digitA
      }
    }
    return 0
  })
  const result = nums.join('')
  return result[0] === '0' ? '0' : result
}

console.log(largestNumber([10,2]))`.trim();

const combinationSum3 = `
const combinationSum3 = function (k, n) {
  const result = []
  const aux = (start, current, sum) => {
    if (current.length > k) {
      return
    }
    if (current.length === k) {
      if (sum === n) {
        result.push([...current])
        return
      }
      return
    }

    for (let i = start; i <= 9; i++) {
      current.push(i)
      aux(i + 1, current, sum + i)
      current.pop(i)
    }
  }
  for (let i = 1; i <= 9; i++) {
    aux(i + 1, [i], i)
  }
  return result
}

console.log(combinationSum3(3,7))`.trim();

const containsDuplicate = `
const containsDuplicate = (nums) => {
  const map = {}
  for (num of nums) {
    if (map[num]) {
      return true
    }
    map[num] = 1
  }
  return false
}

console.log(containsDuplicate([1,2,3,1]))`.trim();

const computeArea = `
const computeArea = function (A, B, C, D, E, F, G, H) {
  const area = (pointA, pointB) => (pointB[0] - pointA[0]) * (pointB[1] - pointA[1])
  const totalArea = area([A, B], [C, D]) + area([E, F], [G, H])
  if (E >= C || G <= A || F >= D || H <= B) {
    return totalArea
  }
  const pointA = [Math.max(A, E), Math.max(B, F)]
  const pointB = [Math.min(C, G), Math.min(D, H)]
  const overlapping = (pointB[0] - pointA[0]) * (pointB[1] - pointA[1])
  return totalArea - overlapping
}

console.log(computeArea(-3, 0, 3, 4, 0, -1, 9, 2))`.trim();

const summaryRanges = `
const summaryRanges = function (nums) {
  let start = null
  const result = []
  for (let i = 0; i < nums.length; i++) {
    if (start === null) {
      start = nums[i]
    }
    if (nums[i] === nums[i + 1] - 1) {
      continue
    }
    if (nums[i] === start) {
      result.push(nums[i].toString())
      start = null
    } else {
      result.push('$'{start}->'$'{nums[i]}')
      start = null
    }
  }
  return result
}


console.log(summaryRanges([1,2,3,4,6,7,9]))`.trim();

const isPowerOfTwo = `
const isPowerOfTwo = (x) => {
  if (x <= 0) {
    return false
  }
  return (x & (x - 1)) === 0
}

console.log(isPowerOfTwo(16))`.trim();

const countDigitOne = `
const countDigitOne = function (n) {
  const memo = {}
  const aux = (number) => {
    if (memo[number] !== undefined) {
      return memo[number]
    }
    if (number <= 0) {
      return 0
    }
    const str = number.toString()
    const first = parseInt(str[0], 10)
    const base = Math.pow(10, str.length - 1)
    const reminder = number - first * base
    if (first === 1) {
      memo[number] = aux(base - 1) + reminder + 1 + aux(reminder)
    } else {
      memo[number] = first * aux(base - 1) + base + aux(reminder)
    }
    return memo[number]
  }
  return aux(n)
}

console.log(countDigitOne(16))`.trim();

const productExceptSelf = `
const productExceptSelf = (nums = []) => {
  if(!nums.length) {
      return nums
  }
  const product = [nums[0]]
  for(let i = 1; i < nums.length; i++) {
      product[i] = nums[i] * product[i-1]
  }
  let suffixProduct = 1
  for(let i = nums.length -1; i >= 1; i--) {
      product[i] = product[i-1] * suffixProduct
      suffixProduct *= nums[i]
  }
  product[0] = suffixProduct
  return product
}

console.log(productExceptSelf([1,2,3,4]))`.trim();

const maxSlidingWindow = `
const maxSlidingWindow = (nums = [], k) => {
  if (!nums.length) {
    return []
  }
  const result = []
  const queue = []
  for (let i = 0; i < k; i++) {
    while (nums[i] > nums[queue[queue.length - 1]]) {
      queue.pop()
    }
    queue.push(i)
  }
  result.push(nums[queue[0]])
  for (let i = 1; i < nums.length - k + 1; i++) {
    if (queue[0] < i) {
      queue.shift()
    }
    while (nums[i + k - 1] > nums[queue[queue.length - 1]]) {
      queue.pop()
    }
    queue.push(i + k - 1)
    result.push(nums[queue[0]])
  }
  return result
}

console.log(maxSlidingWindow([1,3,-1,-3,5,3,6,7], 3))`.trim();

const getFactors = `
const getFactors = function (n) {
  const result = []
  const aux = (remain, start = 2, current = []) => {
    if (remain === 1) {
      if (current.length > 1) {
        result.push([...current])
      }
      return
    }
    for (let i = start; i <= remain; i++) {
      if (remain % i === 0) {
        current.push(i)
        aux(remain / i, i, current)
        current.pop()
      }
    }
  }
  aux(n)
  return result
}

console.log(getFactors(345))`.trim();

const addDigits = `
var addDigits = function(num) {
  function cal(num){
      var s = num.toString();
      var digits = s.split("").map(Number);
      if(digits.length === 1){
          return digits[0];
      }
      num = digits.reduce(function(pre, cur){
          return pre + cur;
      });
      return cal(num);
  }

  return cal(num);
};

console.log(addDigits(38))`.trim();

